import React, { Component } from "react";
import logo from "./logo.svg";
import "./Ziget.css";

export default class Ziget extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="Ziget">
        <header className="Ziget-header">
          <img src={logo} className="Ziget-logo" alt="logo" />
        </header>
        <body>
          <form className="Ziget-form">
            <label className="textarea-label" for="usernames">
              Username(s):
            </label>
            <textarea
              id="usernames"
              autofocus
              rows={10}
              cols={50}
              placeholder="Enter comma(,) seperated Instagram handle. Example: abc,abc_def,abc.def"
            />
            <p>
              Instructions: For the sake of this example please enter comma(,)
              seperated Instagram handles only. Example: abc,abc_def,abc.def{" "}
            </p>
          </form>
        </body>
      </div>
    );
  }
}
